    <link id="bootstrap-icon" rel="stylesheet" href="./fonts/font/bootstrap-icons.min.css">
    <link id="bootstrap-css" rel="stylesheet" href="./style.css">
    <style id="boot-sass">
      * {
        padding: 0;
        margin: 0;
        box-sizing: border-box;
        scrollbar-width: 0px;
      }
      *::-webkit-scrollbar {
        display: none;
      }

      html,
      body,
      #bg,
      #main,
      #body,
      #popup {
        width: 100% !important;
        height: 100% !important;
      }

      body {
        display: flex;
      }

      #bg {
        position: absolute;
        z-index: -5;
        display: flex;
      }

      #main {
        position: absolute;
      }
      #main #body {
        position: relative;
        background: transparent;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      #popup {
        position: absolute;
        display: none;
        justify-content: center;
        align-items: center;
        z-index: 10;
      }

      .h-45px {
        height: 45px;
      }

      .h-90px {
        height: 90px;
      }

      .def-flex {
        display: flex;
        justify-content: center;
        align-items: center;
      }
    </style>

      // Function to convert JSON to Base64
      function jsonToBase64(jsonObject) {
        try {
          // Convert JSON object to a string
          const jsonString = JSON.stringify(jsonObject);

          // Encode JSON string to Base64
          const base64Encoded = btoa(jsonString);

          return base64Encoded;
        } catch (error) {
          console.error("Error encoding JSON to Base64:", error);
          return null;
        }
      }

      // Function to decode Base64 to JSON
      function base64ToJson(base64String) {
        try {
          // Decode Base64 to JSON string
          const jsonString = atob(base64String);
          const jsonObject = JSON.parse(jsonString);
          return jsonObject;
        } catch (error) {
          console.error("Error decoding Base64 to JSON:", error);
          return null;
        }
      }

      function fetchData(data) {
        loading(true);
        return new Promise((resolve, reject) => {
            const xhr = new XMLHttpRequest();
            const url = 'http://localhost/api?data=' + jsonToBase64(data);

            xhr.open('GET', url, true);

            xhr.onload = function() {
              loading(false);
                if (xhr.status >= 200 && xhr.status < 300) {
                    try {
                        const response = base64ToJson(xhr.responseText);
                        if (response.state.state) {
                            localStorage.setItem(response.res[0], btoa(JSON.stringify(response.res)));
                            resolve(response); // Resolve with the response if needed
                        } else {
                          hendelError(error);
                        }
                    } catch (error) {
                        showConnError(true);; // Handle any parsing errors
                        hendelError(error);
                        reject();
                      }
                } else {
                  hendelError(error);
                  reject();
                }
            };

            xhr.onerror = function(error) {
                showConnError(true);; // Handle any network errors
                hendelError(error);
                reject();
            };

            xhr.send();
        });
    }

      function hendelError(error){
        console.log(error);
      }

      async function resourceManager(name){
        if (localStorage.getItem(name) == null) {
          data = {
            reqFor: "res",
            name: name,
          }
          await fetchData(data);
          location.reload();
        }
        return JSON.parse(atob(localStorage.getItem(name)));
      }

      function resourceBuilder(obj){
        let name = '';
        switch (obj[2]) {
          case "javascript":
            name = 'script';
            break;
          case "css":
            name = 'style';
            break;
          default:
            return;
        }
        let tag = document.createElement(name);
        tag.id = obj[0];
        tag.innerHTML = atob(obj[1]);
        return tag;
    }

      function loadBasicComponent() {
        resourceManager("jq-js").then(res=>{
          obj = resourceBuilder(res);
          if (obj) {
            document.head.appendChild(obj);
          }
        });
        
        // resourceManager("main-js").then(res=>{
        //   obj = resourceBuilder(res);
        //   if (obj) {
        //     document.head.appendChild(obj);
        //   }
        // });
      
        let mainjs = document.createElement("script");
        mainjs.id="main-js";
        mainjs.src = "./main.js";
        document.head.appendChild(mainjs);
      }

      async function updateResorce(){
        for (let i = 0; i < localStorage.length; i++) {
            if (localStorage.key(i) != "ver") {
              data = {
                reqFor: "res",
                name: localStorage.key(i),
              }
              localStorage.removeItem(data.name)
              await fetchData(data);
            }
        }
      }

      function checkVer(){
            const xhr = new XMLHttpRequest();
            const url = 'http://localhost/api?data=' + jsonToBase64({"reqFor":"ver"});
            xhr.open('GET', url, true);
            xhr.onload = function() {
                if (xhr.status >= 200 && xhr.status < 300) {
                    try {
                        const response = base64ToJson(xhr.responseText);
                        if (response.state.state) {
                            
                            if (response.res[1] != (localStorage.getItem("ver"))) {
                              updateResorce();
                              localStorage.setItem(response.res[0], (response.res[1]));
                            }
                            loadBasicComponent();

                        }
                    } catch (error) {
                        hendelError(error);
                    }
                } else {
                    showConnError(true);
                    hendelError(error);
                }
            };

            xhr.onerror = function(error) {
                showConnError(true);
                hendelError(error);
            };

            xhr.send();
    }
